    false,nt"url": null,nt"notes": "This digital publication, GPR 2008-1, contains
    geophysical data and a digital elevation model that were produced from airborne
    geophysical surveys conducted in 2007 for part of the western Fortymile mining district,
    east-central Alaska. Aeromagnetic and electromagnetic data were acquired for 250
    sq miles during the helicopter-based survey. Data provided in GPR 2008-1 include
    processed (1) linedata ASCII database, (2) gridded files of magnetic data, a calculated
    vertical magnetic gradient (first vertical derivative), apparent resistivity data,
    and a digital elevation model, (3) vector files of data contours and flight lines,
    and (4) the Contractor's descriptive project report. Data are described in more
    detail in the "GPR2008-1Readme.pdf" and "linedata/GPR2008-1-Linedata.txt" files
    included on the DVD.",nt"license_title": null,nt"extras": [{ntt"key":
